import React, {Component} from 'react';
import PropTypes from 'prop-types';
import Button from 'react-bootstrap/Button';

/**
 * HideIMG
 */
export class HideIMG extends Component { // eslint-disable-line react/prefer-stateless-function
  render() {
    return (
      <div>
            <Button onClick={this.props.hideImg.bind(this)} variant="outline-primary" size="sm">Hide Image</Button>
      </div>
    );
  }
}

HideIMG.propTypes = {
  prop: PropTypes.object.isRequired
}

export default HideIMG;
